import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import {
  HeaderWrapper,
  Logo,
  HeaderItemBar,
  Headernav,
  HeaderLogin,
  HeaderBtn,
  Stick,
  Wrapper,
  ProfileBtn,
} from "./mainStyle"
import Slider from "react-slick";
import Img1 from "../assets/banner/1.jpg"
import Img2 from "../assets/banner/2.jpg"
import Img3 from "../assets/banner/3.jpg"
import Img4 from "../assets/banner/4.jpg"

const Main = () => {

  const settings = {
    dots: false,
    infinite: true,
    speed: 700,
    slidesToShow: 1,
    slidesToScroll: 1,
    ArrowBtn: true,
    // nextArrow: <SampleNextArrow />,
    // prevArrow: <SampleNextArrow />,
    autoplaySpeed: 600,
    autoplay: true,
  };

  const imgslide = [{
    value:0,
    imgurl: Img1
  },{
    value:1,
    imgurl: Img2
  },{
    value:2,
    imgurl: Img3
  },{
    value:3,
    imgurl: Img4
  }]

  return (
    <>
        <HeaderWrapper>
        <Slider {...settings}>
          <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
        </HeaderWrapper>
    </>
  );
};

export default Main;


const StyledSlider = styled(Slider)`
  .slick-slide div {
    outline: none;
  }
`;

const ImageContainer = styled.div`
  margin: 0 auto;
  position: relative;
`;

const Image = styled.img`
  width: 100%;
  height: 650px;
  margin: 0 auto;
`;
